CREATE DEFINER=`root`@`localhost` PROCEDURE `poblar_empleados` (IN `cantidad` INT)   BEGIN
  DECLARE i INT DEFAULT 1;
  DECLARE v_tipo VARCHAR(20);
  DECLARE v_id INT;

  WHILE i <= cantidad DO
    -- tipo de empleado (40% medico, 30% enfermera, 30% administrativo)
    SET v_tipo = CASE
      WHEN RAND() < 0.4 THEN 'medico'
      WHEN RAND() < 0.7 THEN 'enfermera'
      ELSE 'administrativo'
    END;

    VALUES (
      CONCAT('Empleado ', i),
      CASE v_tipo
        WHEN 'medico' THEN ELT(
            FLOOR(1 + RAND() * 5),
            'Cardiólogo','Internista','Pediatra','Cirujano','Neurólogo'
        )
        WHEN 'enfermera' THEN ELT(
            FLOOR(1 + RAND() * 4),
            'Enfermera general','Enfermera quirófano','Enfermera UCI','Enfermera pediatría'
        )
        ELSE ELT(
            FLOOR(1 + RAND() * 4),
            'Administrador','Contador','Jefe de almacén','Recepcionista'
        )
      END,
      DATE_ADD('2015-01-01', INTERVAL FLOOR(RAND() * 3650) DAY),
      v_tipo
    );

    SET v_id = LAST_INSERT_ID();

    -- si es médico, registrarlo también en tabla medico
    IF v_tipo = 'medico' THEN
      VALUES (
        v_id,
        ELT(
          FLOOR(1 + RAND() * 6),
          'Cardiología','Medicina interna','Pediatría',
          'Traumatología','Oncología','Ginecología'
        )
      );
    END IF;

    -- si es administrativo, registrarlo en tabla administrativo
    IF v_tipo = 'administrativo' THEN
      VALUES (
        v_id,
        ELT(
          FLOOR(1 + RAND() * 5),
          'Jefe de administración',
          'Auxiliar administrativo',
          'Responsable de facturación',
          'Coordinador de recursos humanos',
          'Responsable de almacén'
        )
      );
    END IF;

    SET i = i + 1;
  END WHILE;

END$$

CREATE DEFINER=`root`@`localhost` PROCEDURE `poblar_facturas` (IN `cantidad` INT)   BEGIN
  DECLARE i INT DEFAULT 1;
  DECLARE max_pac INT;
  DECLARE f_emision DATETIME;
  DECLARE f_venc DATETIME;
  DECLARE bruto DECIMAL(10,2);
  DECLARE descu DECIMAL(10,2);
  DECLARE base DECIMAL(10,2);
  DECLARE imp DECIMAL(10,2);
  DECLARE neto DECIMAL(10,2);

  SELECT COUNT(*) INTO max_pac FROM paciente;

  WHILE i <= cantidad DO
    SET f_emision = DATE_ADD('2025-01-01', INTERVAL FLOOR(RAND()*365) DAY);
    SET f_venc = DATE_ADD(f_emision, INTERVAL FLOOR(5 + RAND()*25) DAY);

    SET bruto = 500 + FLOOR(RAND()*19500);
    SET descu = ROUND(bruto * (RAND()*0.2), 2);
    SET base = bruto - descu;
    SET imp = ROUND(base * 0.16, 2);
    SET neto = base + imp;

      id_paciente,
      fecha_emision,
      fecha_vencimiento,
      total_bruto,
      total_descuentos,
      total_impuestos,
      total_neto,
      metodo_pago_preferido,
      observaciones
    )
    VALUES (
      1 + FLOOR(RAND() * max_pac),
      f_emision,
      f_venc,
      bruto,
      descu,
      imp,
      neto,
      ELT(
        FLOOR(1 + RAND()*5),
        'Efectivo','Tarjeta','Transferencia','Seguro','Otro'
      ),
      CONCAT('Factura de prueba ', i)
    );

    SET i = i + 1;
  END WHILE;
END$$

