CREATE DEFINER=`root`@`localhost` PROCEDURE `poblar_pagos` ()   BEGIN
  DECLARE i INT DEFAULT 1;
  DECLARE max_fact INT;
  DECLARE neto DECIMAL(10,2);
  DECLARE tipo_pago INT;
  DECLARE monto_pago DECIMAL(10,2);

  SELECT COUNT(*) INTO max_fact FROM factura;

  WHILE i <= max_fact DO
    SELECT total_neto INTO neto FROM factura WHERE id_factura = i;

    SET tipo_pago = FLOOR(RAND()*4); -- 0 pendiente, 1 parcial, 2 pagada, 3 cancelada

    IF tipo_pago = 0 THEN
      UPDATE factura SET estado = 'Pendiente' WHERE id_factura = i;

    ELSEIF tipo_pago = 3 THEN
      UPDATE factura SET estado = 'Cancelada' WHERE id_factura = i;

    ELSEIF tipo_pago = 1 THEN
      -- parcial: entre 10% y 80%
      SET monto_pago = ROUND(neto * (0.1 + RAND()*0.7), 2);
        id_factura,
        fecha_pago,
        monto,
        metodo_pago,
        referencia
      )
      VALUES (
        i,
        DATE_ADD('2025-01-01', INTERVAL FLOOR(RAND()*365) DAY),
        monto_pago,
        ELT(
          FLOOR(1 + RAND()*5),
          'Efectivo','Tarjeta','Transferencia','Seguro','Otro'
        ),
        CONCAT('REF-PARCIAL-', i)
      );
      UPDATE factura SET estado = 'Parcial' WHERE id_factura = i;

    ELSE
      -- pagada: 1 o 2 pagos que sumen neto
      SET monto_pago = ROUND(neto * (0.3 + RAND()*0.4), 2);

        id_factura,
        fecha_pago,
        monto,
        metodo_pago,
        referencia
      )
      VALUES (
        i,
        DATE_ADD('2025-01-01', INTERVAL FLOOR(RAND()*365) DAY),
        monto_pago,
        ELT(
          FLOOR(1 + RAND()*5),
          'Efectivo','Tarjeta','Transferencia','Seguro','Otro'
        ),
        CONCAT('REF-PAGO1-', i)
      );

      IF RAND() < 0.5 THEN
          id_factura,
          fecha_pago,
          monto,
          metodo_pago,
          referencia
        )
        VALUES (
          i,
          DATE_ADD('2025-01-01', INTERVAL FLOOR(RAND()*365) DAY),
          neto - monto_pago,
          ELT(
            FLOOR(1 + RAND()*5),
            'Efectivo','Tarjeta','Transferencia','Seguro','Otro'
          ),
          CONCAT('REF-PAGO2-', i)
        );
      END IF;

      UPDATE factura SET estado = 'Pagada' WHERE id_factura = i;
    END IF;

    SET i = i + 1;
  END WHILE;
END$$

