CREATE ALGORITHM=UNDEFINED DEFINER=`root`@`localhost` SQL SECURITY DEFINER VIEW `vista_facturacion`  AS SELECT `f`.`id_factura` AS `id_factura`, `f`.`id_paciente` AS `id_paciente`, `f`.`fecha_emision` AS `fecha_emision`, `f`.`estado` AS `estado`, (select sum(`d`.`subtotal`) from `detalle_factura` `d` where `d`.`id_factura` = `f`.`id_factura`) AS `total_facturado`, (select sum(`p`.`monto`) from `pago` `p` where `p`.`id_factura` = `f`.`id_factura`) AS `total_pagado`, (select sum(`d`.`subtotal`) from `detalle_factura` `d` where `d`.`id_factura` = `f`.`id_factura`) - (select ifnull(sum(`p`.`monto`),0) from `pago` `p` where `p`.`id_factura` = `f`.`id_factura`) AS `adeudo` FROM `factura` AS `f` ;

